import React from "react"
import { auth } from "../firebase/firebase"; // Assuming you have a firebase config file
import { useNavigate } from "react-router-dom";

function Home() {
    const navigate = useNavigate();
    const logout = () => {
        auth.signOut().then(() => {
          localStorage.clear();
          navigate("/")
        });
      };

    return (
        <div>
            <h1>
                Hello, my friend
            </h1>
            <button onClick={logout}>Logout</button>
        </div>
    )
}

export default Home;
